import React, { Component } from "react";
import photo from "../../photos/index/2ndImage.jpg";

class IndexIntroPhoto extends Component {
  state = {};
  render() {
    return (
      <div>
        <img src={photo} />
      </div>
    );
  }
}

export default IndexIntroPhoto;
